import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="App">
      <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/about" component={About} />
        <Route path="/contact" component={Contact} />
      </Switch>
    </Router>
      <div>
        <Navbar/>
      </div>
    </div>
  );
}

export default App;
